column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<BR>
<img src=http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/evidence/imgrc0064040295.gif><BR>
<img src=http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/img55869438.jpg>
<TABLE border="1" bordercolor="#ffccff" width="365" cellpadding="2" cellspacing="4">
  <TBODY>
    <TR>
      <TD bgcolor="#ff00ff"><FONT color="#ffffff" size="-1">■商品名</FONT></TD>
    </TR>
    <TR bgcolor="#ffecff">
      <TD><FONT size="-1" color="#525252">■CN3401 西川 ドライウェルプラス セミダブル</FONT></TD>
    </TR>
    <TR>
      <TD bgcolor="#ff00ff"><FONT color="#ffffff" size="-1">■商品説明</FONT></TD>
    </TR>
    <TR bgcolor="#ffecff">
      <TD><FONT size="-1" color="#525252">
優れた吸湿性をもつモイスファイン(R)EXを使用し、<br>
布団の間や下に敷くだけで両面から湿気を吸収します。<br><br>
フローリングや畳にも敷くだけですので手間いらず。<br>
吸湿量が多いので敷きっぱなしでもセンサーがお知らせ<br><br>
通気の悪いお部屋や1階の湿気が多い場所に有効です。<br>
センサーの色が変わったら干して下さい。<br><br>
センサーを両面に設置したため、表裏関係なく、<BR>
どちらでも使いやすいようになりました。<bR><BR>
</FONT></TD>
    </TR>
<TD bgcolor="#ff00ff"><FONT color="#ffffff" size="-1">■商品情報</FONT></TD>
    </TR>
    <TR bgcolor="#ffecff">
      <TD><FONT size="-1" color="#525252">
■110×180cm　■日本製　■リバーシブル<br>
■ポリエステル60％モイスファイン(R)EX40％<BR>
■SEK抗菌防臭加工<BR>■商品番号 CNT1283402<BR>
</font>
</TD></tr></td>
<TD bgcolor="#ff00ff"><FONT color="#ffffff" size="-1">■メーカー</FONT></TD>
    </TR>
    <TR bgcolor="#ffecff">
      <TD><FONT size="-1" color="#525252">■西川産業株式会社：東京西川</FONT></TD></TR>
<TD bgcolor="#ff00ff"><FONT color="#ffffff" size="-1">■その他</FONT></TD>
    </TR>
    <TR bgcolor="#ffecff">
      <TD><FONT size="-1" color="#525252">■在庫状況によりお取り寄せです。</FONT></TD></TR>

    </TR>

</TBODY>
</TABLE><style type="text/css">

/*span.unit { background: url(http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/03289045/imgrc0063979001.jpg) no-repeat left top; text-indent:
-9999; display: block; width: 365; height: 280; margin:15px 0; }*/


.item_name {
display:block;
margin-bottom:0px;
}


.catch_copy {
display:block;
margin-bottom:0px;
}

/*個数入力*/
input#units {
  border:solid #ccc 1px;
  background:#fff!important;
  width:30px;
  height:30px;
  cursor:auto;
  padding:7px 7px 7px 3px;
}


div#rakutenLimitedId_aroundCart td font[size="3"] {
  color: #C00;
  font-size: 20px;
  font-weight: bold;
  line-height:160%;
}


span.catch_copy,
span.item_name {
  line-height: 200%;
}

/* キャッチコピー上部にラベルがつく */
span.catch_copy:before {
    content: "10,800円以上のお買い物で送料無料！(沖縄は除く)"; /*ラベル内の文言*/
    width: 365px; /*ラベルのサイズ*/
    background-color: #bf0000; /*ラベルの色*/
    font-size: 13px;
    color: #FF0;
    text-align: center;
    display: block;
    padding: 1px 4px;
    margin-bottom: 4px;
    border-radius: 2px;
    clear: both;
}

/* 商品名下に境界線が入る */
span.item_name {
    display: block;
    border-bottom: 2px dotted #ddd;
    padding-bottom: 15px;
}

/* 価格に枠線がつく */
table#rakutenLimitedId_cart {
    background-color: #f8f8f8;
    border: 1px solid #ddd;
    padding: 8px;
    margin: 16px 0;
}

span.price1 {
    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}


/*買い物かごボタン*/
#rakutenLimitedId_aroundCart span.unit{
 font-size:18px; /*店舗ごとに任意*/
 font-weight:bold; /*店舗ごとに任意*/
 height:260px; /*店舗ごとに任意*/
}

#rakutenLimitedId_aroundCart input#units {
 border:solid 5px #ccc; /*店舗ごとに任意*/
 width: 50px !important; /*店舗ごとに任意*/
 height: 50px !important; /*店舗ごとに任意*/
 cursor:auto;
 text-indent:0px; /*店舗ごとに任意*/
 overflow:hidden;
}

body div#pagebody #rakutenLimitedId_aroundCart input.rCartBtn,
body div#pagebody #rakutenLimitedId_aroundCart input#units + input {
 width: 300px !important; /*店舗ごとに任意*/
 height: 50px !important; /*店舗ごとに任意*/
 background: url(http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0063981590.gif) no-repeat !important; /*店舗ごとに任意*/
 overflow:hidden !important;
 border-width: 0px !important;
 cursor: pointer !important;
 text-indent:150% !important; /*店舗ごとに任意*/
 white-space:nowrap !important;
 margin:5px 0 !important; /*店舗ごとに任意*/
}

/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
width: 337px;
height: 36px;
background: url(http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0062319353.gif) no-repeat;
overflow:hidden;
border-width: 0px;
cursor: pointer;
display:block;
background-color:#898989;
text-indent:150%;
}

/*opera対応*/

body #rakutenLimitedId_aroundCart button.rAskBtn {
width: 337px !important;
height: 36px !important;
background: url(http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0062319353.gif) no-repeat !important;
overflow:hidden !important;
border-width: 0px !important;
cursor: pointer !important;
display:block !important;
background-color:#898989 !important;
text-indent:-9999px !important;
}

/* お気に入り商品登録 */
div.bookmarkArea {
	width:365px;
}

#rakutenLimitedId_aroundCart #serviceTableSml {
	margin-top:-1px;
}

body div.bkm{
	width: 337px !important;
	height: 200px !important;
}

body div.bookmarkArea div.bkm a.addBkm span.bkmStar {
	display:inline-block !important;
	width: 337px !important;
	height: 200px !important;
	background: url(http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0062330651.gif) no-repeat !important;
}

/* お気に入り店舗登録 */
body #rakutenLimitedId_aroundCart div.shopBkm {
	padding:10px 0px 0px 0px !important;
	width: 337px !important;
	height: 36px !important;
}

body div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
	display:inline-block !important;
	width: 337px !important;
	height: 36px !important;
	background: url(http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0062319354.gif) no-repeat !important;
}



 /*IE対応*/
*html font input {
  background:#fcfcfc no-repeat 9px 8px;
  margin-bottom:6px;
}

select[name="choice"]{
	height:30px;width:365px;	
}

/*項目選択肢*/
.choice{
	display:block;
	margin:20px 0px 10px 0px;
  text-indent:-9999px;
	border:none;	
background-image:url("http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0063968550.gif");
	background-repeat:no-repeat;
	background-position:left center; 
	width:365px;
	height:45px;
	padding:8px 0px 0px 10px;
	margin-bottom:15px;
}


</style>
<img src="http://image.rakuten.co.jp/auc-nemurinokamisama/cabinet/imgrc0066383381.gif">

